('2326','18','7334a','Villa Lara',Null,'Einfamilienhaus mit Pool in 1. Meereslinie in El Toro','32840','El Toro liegt in der Gemeinde Calvia im Südwesten Mallorcas. El Toro bietet nicht nur eine ganzjährig funktionierende Infrastruktur mit Supermärkten und Restaurants, sonder auch den beliebten Jachthafen Port Adriano mit seinen bekannten Restaurants und Edelboutiquen. In unmittelbarer Umgebung kommen auch die Golfer voll auf Ihre Kosten. 4 Golfplätze stehen zur Auswahl.\r\nDas Haus wurde 1995 auf einem 630m² großen, südwestlich ausgerichteten Meerblick Grundstück erstellt. Die 220m² Wohnfläche verteilt sich auf 2 Etagen plus Fitnessraum im Keller. Im EG befinden der Eingang mit Diele, Wohnesszimmer mit Kamin, Küche mit Hauswirtschaftsraum, 1 Badezimmer und eine Garage mit Platz für 1 PKW: Im Obergeschoss befinden sich das Hauptschlafzimmer mit Ankleide, 3 Schlafzimmer, 1 Badezimmer und eine Terrasse. Im Außenbereich hat es noch einen Pool sowie einen mediterranen Garten mit mehreren Terrassen. Zur Ausstattung gehören eine Öl Zentralheizung, PVC Doppelglasfenster und eine Klima Anlage w/k.\r\n','32841','1980000','106','2015-04-30 12:20:27','106','2015-04-30 12:21:24',Null,'2383','89','1122',1,'1','0',Null,Null,Null,'32842',Null,'0','0','0',Null,'2015-04-30 12:38:19',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32843',Null,'32844',Null,'32845',Null,'32846','607260965','32847','0',0,'5');
